export const CREATE_STAFFPATIENT_STARTED = "CREATE_STAFFPATIENT_STARTED";
export const CREATE_STAFFPATIENT_COMPLETED = "CREATE_PATIENTSTAFF_COMPLETED";
export const CREATE_STAFFPATIENT_FAILED = "CREATE_STAFFPATIENT_FAILED";


export interface IPatientStaffAssignment {
    status: {
      statusCode: number;
      statusDisplay: string;
      statusValue: boolean; 
    };
    items: Array<any>;
    loginInput: {
      userId: string;
      username:string,
      password: string;
      organization:string;
      jwtToken: string;
      secretKey: string,
      email:string,
      otp:string,
      confirmNewPass: string,
      newPassword:string,
      patientid:string,
      securityQuestion: string;
      answer: string;
      roleFkId: {
        roleId: number;
        roleName: string;
        description: string;
        status: number;
        GETdAt: Date;
        createdBy: string;
        updatedAt: Date;
        updatedBy: string;
      };
      status: number;
      createdAt: Date;
      createdBy: string;
      updatedAt: Date;
      updatedBy: string;
    };
    loginID: number;
    isLoading: boolean;
    error: string;
  }


  export const assignstaffPatient = (loginInput: any) => { 
    
    return {
      type: CREATE_STAFFPATIENT_STARTED,
      payload: "status",
      input: loginInput
    };
  };
